import React from "react";
import Slider from "react-slick";
import '../../../public/assets/img/banner';


export default function Category() {
  var settings = {
    dots: true,
    infinite: true,
    speed: 500,
    slidesToShow: 5,
    slidesToScroll: 1
  };
  return (
    <div className="container">
    <Slider {...settings}>
    
      <div>
      <img src="../../../public/assets/img/banner" alt="..." class="img-rounded"/>
      </div>
      <div>
        <h3>2</h3>
      </div>
      <div>
        <h3>3</h3>
      </div>
      <div>
        <h3>4</h3>
      </div>
      <div>
        <h3>5</h3>
      </div>
      <div>
        <h3>6</h3>
      </div>
    
    </Slider>
    </div>
  );
}
